import React from "react";
import ProfileInfo from "./ProfileInfo/ProfileInfo";
import MyPostsContainer from "./MyPosts/MyPostsContaner";


const Profile = (props) => {


    return  <div >
      <ProfileInfo  ownerId={props.authorizedUserId} getUsersProfile={props.getUsersProfile} setPhotoApi={props.setPhotoApi} profile={props.profile} photo={props.photo} status={props.status} updateStatus={props.updateStatus}/>
      <MyPostsContainer/>


    </div>
}

export default Profile
